ADOBE PHOTOSHOP ELEMENTS 8

The complete solution for your photos and videos
Adobe Photoshop Elements 8 software gives you power and ease of use so you can 
do some amazing storytelling with photos and videos. Create extraordinary photos 
and incredible movies, and use them together in cinematic slide shows and more.

Use Adobe Photoshop Elements 8 software for all your photo needs. Manage, edit, 
and enhance photos; make unique photo creations and share in print, on the web, 
and on mobile devices.

Easily manage everything from one convenient place enhanced 
Bring all your photos and video clips together in the easy-to-use Organizer 
now a more powerful hub for your photo and video experience. It's easier than ever 
to find, view, manage, and protect your media and then dive into a full range of 
creative activities and start enjoying your memories.

Select and apply with a single stroke enhanced 
Simultaneously select a specific photo area and apply incredible effects with a 
single stroke of new Smart Brush. Improve lighting, add rich textures, and more 
with 8 libraries of over 50 sophisticated effects.

Dramatically transform your photos with easy-to-use options
Convert your color originals to elegant, nuanced black-and-whites, or use color 
curves adjustments to get the perfect exposure.

Count on step-by-step assistance
Want to touch up a scratch? Create a scrapbook page? Add artistic effects that 
make a photo look like a pencil sketch? Get help with key steps to get the 
results you want fast.

